@import url("./phone.css");
@import url("./keyframes.css");

@import url("https://fonts.googleapis.com/css2?family=Montserrat:wght@500&display=swap");


@media (min-width: 600px) {
    body {
        background-color: #31302d;
        font-family: "Montserrat", sans-serif;
        overflow: hidden;
        /* touch-action: manipulation; */
    }
    .main-container {
        width: 100vw;
        height: 100vh;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-wrap: wrap;
    }
    .container {
        display: flex;
        width: 600px;
        height: 600px;
        flex-wrap: wrap;
        border-radius: 1%;
        overflow: hidden;
    }

    .container2 {
        height: 600px;
        width: 500px;
        background-color: #262522;
        margin-left: 40px;
        margin-right: 40px;
        border-radius: 1%;
        overflow: hidden;
    }
    .outer-top-round-section {
        height: 50px;
        background-color: #21201d;
    }
    .top-round-section {
        height: 100px;
        width: 100%;
        background-color: #21201d;
        border-radius: 50%;
    }
    .box {
        height: 75px;
        width: 75px;
        position: relative;
    }

    .corner {
        position: relative;
    }

    .bottom-Right {
        position: absolute;
        bottom: 0;
        right: 0;
        margin: 0 5px 3px 0px;
    }

    .top-right {
        font-weight: 400;
        margin: 5px 0 0 4px;
    }

    .end-section {
        position: relative;
        bottom: -25px;
        left: 0;
        right: 0;
        height: 180px;
        justify-content: end;
        background-color: #21201d;
        padding-left: 30px;
        padding-right: 30px;
        padding-top: 20px;
        text-align: center;
    }

    .training-text,
    .color-text {
        font-size: 13px;
        margin-bottom: 5px;
        text-align: left;
    }

    .show-coordinates {
        color: lightgray;
        font-size: 13px;
        margin-left: 5px;
    }

    .middle-content {
        text-align: center;
        height: 325px;
        width: 100%;
        color: white;
        background-color: #262522;
        background-color: transparent;
        position: relative;
        bottom: 30px;
        font-size: 30px;
        font-weight: 900;
    }

    .vision {
        margin-top: 10px;
        margin-bottom: 50px;
        border-radius: 1.5%;
    }

    .personal-best {
        margin-top: 5px;
        font-size: 11px;
        color: gray;
    }

    .game-mode-setting {
        display: flex;
        color: white;
        display: flex;
    }

    .current-score {
        width: 230px;
        font-size: 30px;
        color: white;
    }

    

    select {
        width: 215px;
        height: 32px;
        background-color: #383734;
        color: white;
        border-radius: 5%;
        border: 1px solid #4d4c47;
        font-family: Arial;
    }
    select:hover {
        border: 1px solid white;
    }

    .training-mode {
        margin-right: 10px;
    }

    input[type="checkbox"] {
        appearance: none;
        height: 15px;
        width: 15px;
        cursor: pointer;
        display: flex;
        align-items: center;
        justify-content: center;
        border-radius: 15%;
        background-color: rgb(163, 163, 163);
    }

    input[type="checkbox"]::after {
        content: "\f00c";
        font-family: "font Awesome 5 free";
        font-weight: 900;
        font-size: 12px;
        border: none;
        outline: none;
    }
    input[type="checkbox"]:hover {
        background-color: lightgray;
    }

    input[type="checkbox"]:checked {
        background-color: #21201d;
        border: 1px solid white;
    }
    input[type="checkbox"]:checked::after {
        display: none;
    }

    .checkBox-container {
        display: flex;
        align-items: center;
        justify-content: center;
        position: relative;
        margin-top: 10px;
    }

    .start-underneath {
        width: 100%;
        height: 50px;
        border-radius: 10px;
        outline: none;
        border: none;
        background-color: #779954;
        position: relative;
        top: 25px;
    }

    .start {
        width: 100%;
        height: 55px;
        border-radius: 10px;
        outline: none;
        border: none;
        background-color: #8eb453;
        position: relative;
        bottom: 40px;
        font-size: 20px;
        color: white;
        font-weight: 900;
        cursor: pointer;
    }

    .start:hover {
        background-color: #aad16f;
    }

    .after-start-top {
        height: 75px;
        width: 100%;
        background-color: rgb(228, 227, 227);
        display: flex;
        align-items: center;
        justify-content: center;
    }

    .box-before-number {
        height: 25px;
        width: 25px;
        background-color: white;
        border: 2px solid lightgray;
    }

    .sidebar-container {
        display: flex;
        align-items: center;
        justify-content: space-between;
        padding-right: 40px;
        padding-left: 40px;
        margin-top: 30px;
    }
    .timer-container {
        display: flex;
        align-items: center;
        justify-content: space-between;
        color: white;
        font-size: 25px;
        width: 85px;
    }

    .clock {
        height: 20px;
        width: 20px;
        background-color: transparent;
        border: 2px solid lightgray;
        border-radius: 50%;
        display: flex;
        align-items: center;
        justify-content: center;
    }

    .clock-stick {
        width: 8px;
        height: 2px;
        background-color: lightgray;
        position: relative;
        right: 4px;
        transform-origin: right center;
    }

    .time {
        height: 30px;
        width: 55px;
    }
    .three-two-one-container {
        display: flex;
        justify-content: center;
        position: relative;
        bottom: 415px;
        left: 263px;
        opacity: 1;
        text-align: center;
        pointer-events: none;
        height: 190px;
        width: 300px;
    }
    .three-two-one {
        font-size: 150px;
        color: white;
        text-shadow: 1px 1px 5px black;
    }
    .timeUp {
        height: 190px;
        width: 190px;
        display: none;
    }

    .random-number-for-right-top {
        font-size: large;
        margin-left: 5px;
        font-weight: bolder;
    }

    .wrong-answer {
        height: 30px;
        width: 30px;
        background-color: red;
        border-radius: 50%;
        display: flex;
        align-items: center;
        position: absolute;
        bottom: 60px;
        left: 60px;
        z-index: 1;
    }

    .line-1 {
        height: 4px;
        width: 25px;
        background-color: white;
        position: relative;
        left: 2px;
        transform-origin: middle center;
        rotate: 45deg;
    }
    .line-2 {
        height: 4px;
        width: 25px;
        background-color: white;
        rotate: 90deg;
    }
    .right-answer {
        height: 30px;
        width: 30px;
        background-color: #9cc96f;
        border-radius: 50%;
        display: flex;
        align-items: center;
        position: absolute;
        bottom: 60px;
        left: 60px;
        z-index: 1;
    }

    .right-line-1 {
        height: 4px;
        width: 35px;
        background-color: white;
        position: relative;
        top: 2px;
        left: 7px;
        transform-origin: middle center;
        rotate: -45deg;
    }
    .right-line-2 {
        height: 4px;
        width: 20px;
        background-color: white;
        position: relative;
        top: 5px;
        right: 16px;
        transform-origin: middle end;
        rotate: 45deg;
    }

    .after-start-end {
        width: 430px;
        margin: 40px auto 0 auto;
        display: flex;
        flex-wrap: wrap;
    }

    .streak-icons {
        height: 45px;
        width: 20px;
        margin: 4.359px;
        font-size: small;
        font-weight: 500;
        text-align: center;
        display: flex;
        flex-direction: column;
        justify-content: space-around;
    }

    .steak-cross-icon {
        width: 100%;
        height: 20px;
        background-color: red;
        border-radius: 2px;
    }

    .steak-cross-icon-line-1 {
        height: 4px;
        width: 20px;
        background-color: white;
        position: relative;
        top: 8px;
        transform-origin: middle center;
        rotate: 45deg;
    }
    .steak-cross-icon-line-2 {
        height: 4px;
        width: 20px;
        background-color: white;
        rotate: 90deg;
    }

    .steak-tick-icon {
        width: 100%;
        height: 20px;
        background-color: #9cc96f;
        border-radius: 2px;
        display: flex;
        align-items: center;
    }

    .steak-tick-icon-line-1 {
        height: 4px;
        width: 35px;
        background-color: white;
        position: relative;
        top: 1px;
        left: 5px;
        transform-origin: middle center;
        rotate: -45deg;
    }
    .steak-tick-icon-line-2 {
        height: 4px;
        width: 20px;
        background-color: white;
        position: relative;
        top: 3px;
        right: 10px;
        transform-origin: middle end;
        rotate: 45deg;
    }
}
